// Rows ========================================

var Rows = exports.Rows = {};

Rows.read = function (pbf, end) {
    return pbf.readFields(Rows._readField, {row: []}, end);
};
Rows._readField = function (tag, obj, pbf) {
    if (tag === 1) obj.row.push(Row.read(pbf, pbf.readVarint() + pbf.pos));
};
Rows.write = function (obj, pbf) {
    if (obj.row) for (var i = 0; i < obj.row.length; i++) pbf.writeMessage(1, Row.write, obj.row[i]);
};
